// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.7.0 <0.9.0;

contract twoTimeMappintC {

struct Record {
  // address owner;
   //uint id;
   string name;
   string senderaddress;
   string reciveraddress;
   string scheduletime;
   string scheduledate;
  // uint Index;
   uint time;
}

    mapping (uint => mapping (uint => uint)) recordIndex;

    mapping (uint => Record[]) records;
                                    //string memory, string memory, string memory, string memory, string memory, uint
    function getrec(uint id , uint time) public view returns (Record memory ) {
        uint index = recordIndex[id][time];
        // We use index = 0 to indicate an invalid time
        //require(index > 0, "invalid time");
        index -= 1;
        string memory a = records[id][index].name;
        string memory b = records[id][index].senderaddress;
        string memory c = records[id][index].reciveraddress;
        string memory d = records[id][index].scheduletime;
        string memory e = records[id][index].scheduledate;
        uint f = records[id][index].time;

        return Record(a, b, c, d, e, f);
    }

}

